import React, { Component } from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch
} from 'react-router-dom';
import Proba from './components/Proba';

const Dodaj = ({match}) => (
    <Product category={match.params.category} />

)




class App extends Component {
  render() {
    return (
      <Router>
        <div>
          <div>
            <ul>
              <h2>Accaunts</h2>
              <li><Link to='/netfilx'>Netfilx</Link></li>
              <li><Link to='/a'>A</Link></li>
              <li><Link to='/b'>B</Link></li>
              <li><Link to='/c'>C</Link></li>
            </ul>

            <Route path='/:id' component={Child} />
            </div>

            <div>
          <ul>
            <h2>Accaunts</h2>
            <li><Link to='nesto/netfilx'>Netfilx</Link></li>
            <li><Link to='nesto/a'>A</Link></li>
            <li><Link to='nesto/b'>B</Link></li>
            <li><Link to='nesto/c'>C</Link></li>
          </ul>

          <Switch>
            <Route exact path='/' component={Home} />
            <Route path='/product' component={Product} />
            <Route path='/product/:category' component={Dodaj} />

          </Switch>
        </div>
        </div>
      </Router>
    );
  }
}

export default App;
